import React, { useState } from 'react'
import BlogCard from '../Blogs/BlogCard'
import FilterDropdown from '../Assets/FilterDropdown'
import PortionEnd from '../Assets/PortionEnd'
import { useParams } from 'react-router-dom'

export default function BrowseBlogs() {
    const params = useParams();
    useLayoutEffect(() => {
        FetchPosts();
      }, []);
      async function FetchPosts() {
        setIsLoading(true);
        await fetch("http://localhost:8000/api/fetch-posts", {
          method: "post",
          headers: {
            "Content-Type": "application/json",
          },
        })
          .then((Response) => {
            return Response.json();
          })
          .then((Data) => {
            setIsLoading(false);
            setPosts(Data.data);
          })
          .catch((e) => {
            console.log(e);
          });
      }
    const [SearchSuggestion, setSearchSuggestion] = useState(false);
    const planSort = [
        { id: 'plan-0', value: 'Both' },
        { id: 'plan-1', value: 'Free' },
        { id: 'plan-2', value: 'Pro Essential' }
    ]
    const assetsSort = [
        { id: 'asset-0', value: 'HTML 5' },
        { id: 'asset-1', value: 'CSS 3' },
        { id: 'asset-2', value: 'Javascript' },
        { id: 'asset-3', value: 'Jquery' },
        { id: 'asset-4', value: 'React Js' }
    ]
    const ItemsSort = [
        { id: 'item-0', value: 'Most Popular' },
        { id: 'item-1', value: 'Likes High to Low' },
        { id: 'item-2', value: 'Likes Low to High' }
    ]

    return (
        <>
            <div className="browse-cards-container">
                <div className="search-input-container">
                    <div className='search-input-head'>Browse Like Hunters</div>
                    <form>
                        <input type="text" placeholder="Search..." />
                        <div className='search-bar-icons'><i className='fa-regular fa-xmark'></i></div>
                        <div className='search-bar-icons'><i className='fa-regular fa-magnifying-glass'></i></div>

                        {SearchSuggestion && <div className="suggestions-container">
                            <ul className="suggestions-list">
                                <li><a>How to use canva premium for free in desktop</a></li>
                                <li><a>How to use canva premium for free in desktop</a></li>
                                <li><a>How to use canva premium for free in desktop</a></li>
                                <li><a>How to use canva premium for free in desktop</a></li>
                                <li><a>How to use canva premium for free in desktop</a></li>
                                <li><a>How to use canva premium for free in desktop</a></li>
                            </ul>
                        </div>
                        }
                    </form>
                </div>
                <div className='browse_results'>
                    <h1>Navigation Hero Slider</h1>
                    <p>Discover an Amazing & Inspiring Website Useful Components.</p>
                </div>
                <div className='filter-topbar'>
                    <div className='filter-topbar-head'>
                        All Filters
                    </div>
                    <div className='filter-dropdowns'>
                        <FilterDropdown List={assetsSort} btnIcon="fa-regular fa-tag" Unique="one" Type={"checkbox"} btnTitle="Select Assets" IsCheck={true} Search={true} />
                        <FilterDropdown List={planSort} btnIcon="fa-regular fa-crown" Unique="two" Type={"radio"} btnTitle="Free/Pro" IsCheck={true} />

                        <FilterDropdown List={planSort} btnIcon="fa-regular fa-list" Unique="four" btnTitle="Select Category" />
                        <FilterDropdown List={ItemsSort} btnIcon="fa-regular fa-sort" Unique="three" btnTitle="Sorting Items" />
                    </div>

                </div>
                <div className="post-grid ">
                    
                    {/* <BlogCard />
                    <BlogCard />
                    <BlogCard />
                    <BlogCard />
                    <BlogCard />
                    <BlogCard />
                    <BlogCard />
                    <BlogCard />
                    <BlogCard />
                    <BlogCard />
                    <BlogCard />
                    <BlogCard /> */}
                </div>
                <PortionEnd title="Load more articles" />
            </div>
        </>
    )
}
